function App() {
  return (
    <div style={{ textAlign: 'center' }}>
      <Parallax bgImage={ image1 } strength={500}>
        <div style={{ height: 500 }}>
          <div>Nos Cardigans, c'est d'abord une question de mati√®re.</div>
        </div>
